const Navigation=({onRouteChange,isSignedIn})=>{
    if(isSignedIn){
        return(
            <nav style={{display:'flex',justifyContent:'flex-end'}}>
                <p onClick={()=>onRouteChange('signin')} className='f3 dim link black underline pa3 pointer'>Sign out</p>
            </nav>
        );
     }
     else{
         return(
            <nav style={{display:'flex',justifyContent:'flex-end'}}>
                <p onClick={()=>onRouteChange('home')} className='f3 dim link black underline pa3 pointer'>Sign In</p>
                <p onClick={()=>onRouteChange('register')} className='f3 dim link black underline pa3 pointer'>Register</p>
            </nav>
         )
     }
}

export default Navigation;
